import React from "react";
import { Form } from "react-bootstrap";
import { CustomInput } from "./CustomInput";

export const TransForm = () => {
  const handleOnSubmit = (e) => {};
  const inputs = [
    {
      label: "Email",
      type: "email",
      name: "email",
      required: true,
    },
    {
      label: "Date",
      type: "date",
      name: "date",
      required: true,
    },
    {
      label: "Title",
      type: "text",
      name: "title",
      required: true,
    },
    {
      label: "Amount",
      type: "number",
      name: "amount",
      required: true,
    },
  ];
  return (
    <div>
      <Form>
        {inputs.map((item, i) => (
          <CustomInput key={i} {...item} />
        ))}
      </Form>
    </div>
  );
};
